import { Injectable } from '@angular/core';
import { Router } from '@angular/router';
import { Market } from '@ionic-native/market/ngx';
import { SocialSharing } from '@ionic-native/social-sharing/ngx';
import { AlertController, LoadingController, ToastController } from '@ionic/angular';
import { ApiService } from './api.service';
import { FileTransfer, FileUploadOptions, FileTransferObject } from '@ionic-native/file-transfer/ngx';
import { File } from '@ionic-native/file/ngx';
import { VideoEditor } from '@ionic-native/video-editor/ngx';
import { AdmobfreeService } from 'src/app/services/admobfree.service';

@Injectable({
	providedIn: 'root'
})
export class GlobalService {
	allVideoLanguage: any = [];
	allVideoLangTemp: any = [];
	myVideosDownload: any = [];
	myQuotesDownload: any = [];
	homeVideos: any = [];
	userData: any = {};
	loading: any;
	device_token: any;
	crVersion: any;
	appNewVersion: any;
	appLogo: any = 'data:image/png;base64,'
	myFavVideos: any = [];
	myFavQuotes: any = [];
	isFavVideo: boolean = false;
	isFirstTime: boolean = false;
	isSpinner: boolean = false;
	isAndroid11: boolean = false;
	selectedLang: any = [];
	wholeWBData: any = [];
	images: any = [];
	wholeVideos: any = [];
	wholeWPVideo: any = [];
	indexeeee: any = 0;
	homeTotalRecord: any = 0;
	catTotalRecord: any = 0;
	videos: any = [];
	wholeWPAndroid11Video: any = [];

	constructor(
		public market: Market,
		public socialSharing: SocialSharing,
		public router: Router,
		public alertController: AlertController,
		public loadingController: LoadingController,
		public api: ApiService,
		public tc: ToastController,
		public fileTransfer: FileTransfer,
		private videoEditor: VideoEditor,
		public admobS: AdmobfreeService,
		public file: File
	) {
		this.myFavVideos = JSON.parse(window.localStorage.getItem("FSVideostatus")) || [];
		this.myFavQuotes = JSON.parse(window.localStorage.getItem("FSVidstatusQuotes")) || [];
		this.selectedLang = JSON.parse(window.localStorage.getItem("selectedLanguages")) || [];
	}

	getLanguageList() {
		this.presentLoading('Videos loading...');
		this.isSpinner = true;
		this.api.post('getLanguageList', '').then(async (res) => {
			if (res['ResponseCode'] == 1) {
				this.allVideoLanguage = res['ResultData'];

				this.allVideoLanguage = await this.sortByKeyDesc(this.allVideoLanguage, 'language_id');
				// let tempLang = [];
				// const setCatLang = () => {
				for (let i in this.allVideoLanguage) {
					if (this.allVideoLanguage[i].language_id == "8") {
						// Ads Dynamic Details
						this.admobS.rendomAds = JSON.parse(this.allVideoLanguage[i].language_name);
						this.allVideoLanguage.splice(i, 1)
					}

					this.allVideoLangTemp.push({
						type: 'checkbox',
						label: this.allVideoLanguage[i].language_name,
						value: this.allVideoLanguage[i].language_id,
						checked: ''
					})
					if (this.selectedLang && this.selectedLang.length) {
						for (let i in this.allVideoLanguage) {
							if (this.selectedLang.indexOf(this.allVideoLanguage[i].language_id) != -1) {
								this.allVideoLanguage[i].isChecked = true;
							}
						}
					}

					if (!this.selectedLang.length || this.isFirstTime) {
						this.isFirstTime = true;
						this.allVideoLanguage[i].isChecked = true;
						// this.selectedLang.push(this.allVideoLanguage[i].language_id)
					}
				}

				console.log(">>>>>>>>" + JSON.stringify(this.admobS.rendomAds));

				// }
				// await setCatLang();

				// this.getHomeVideos({
				// 	language_id: String(this.selectedLang),
				// 	start: this.randomInteger(0, 60),
				// });
			} else {
				this.messageToast('Something went wrong');
				this.dissmisLoding();
				this.isSpinner = false;
			}
		}, err => {
			console.log("errgetLanguageList>>>>>>>>" + JSON.stringify(err));
			this.dissmisLoding();
			this.isSpinner = false;
			this.messageToast('Something went wrong');
		})
	}

	isLangCheck(language_id) {
		if (this.selectedLang.length) {
			for (let i in this.selectedLang) {
				if (this.selectedLang[i] == language_id) {
					return true
				}
			}
		} else {
			return true
		}
	}

	getHomeVideos(body) {
		this.api.post('getHomePageVideoList', body).then((res) => {
			this.homeVideos = [];
			if (res['ResponseCode'] == 1) {
				this.homeVideos = res['ResultData'];
				this.homeTotalRecord = (res['total_record'] - 10);
			} else {
				this.messageToast('Something went wrong');
			}
			if (body && body.event) {
				body.event.target.complete();
			}
			this.dissmisLoding();
			this.isSpinner = false;
		}, err => {
			this.dissmisLoding();
			this.isSpinner = false;
			this.messageToast('Something went wrong');
		})
	}

	increateCount(video_id, type) {
		let body = {
			video_id: video_id,
			type: type
		}
		this.api.post('increateCount', body).then((res) => {
			if (res['ResponseCode'] == 1) {
			} else {
				this.messageToast('Something went wrong');
			}
		}, err => {
			this.messageToast('Something went wrong');
		})
	}

	quotesIncreateCount(quotes_id, type) {
		let body = {
			quotes_id: quotes_id,
			type: type
		}
		this.api.Qpost('increateCount', body).then((res) => {
			if (res['ResponseCode'] == 1) {
			} else {
				this.messageToast('Something went wrong');
			}
		}, err => {
			this.messageToast('Something went wrong');
		})
	}

	// Video Fav
	setFavourites(vidRow) {
		this.admobS.rendomAdShow();
		this.myFavVideos.push(vidRow);
		window.localStorage.setItem("FSVideostatus", JSON.stringify(this.myFavVideos));
		this.checkFavVideo(vidRow.video_id);
		vidRow.video_favourite = Number(vidRow.video_favourite) + 1;
		this.increateCount(vidRow.video_id, '3');
	}

	checkFavVideo(video_id) {
		this.isFavVideo = false;
		for (let i in this.myFavVideos) {
			if (this.myFavVideos[i].video_id == video_id) {
				this.isFavVideo = true;
			}
		}
	}

	removeFavVideo(video_id) {
		this.admobS.rendomAdShow();
		for (let i in this.myFavVideos) {
			if (this.myFavVideos[i].video_id == video_id) {
				this.myFavVideos.splice(i, 1);
				window.localStorage.setItem("FSVideostatus", JSON.stringify(this.myFavVideos));
				setTimeout(() => {
					this.checkFavVideo(video_id);
				}, 100);
			}
		}
	}
	// Quotes Fav END


	// Quotes Fav
	setFavouritesQuotes(quotRow) {
		this.admobS.rendomAdShow();
		this.myFavQuotes.push(quotRow);
		window.localStorage.setItem("FSVidstatusQuotes", JSON.stringify(this.myFavQuotes));
		this.checkFavQuotes(quotRow.quotes_id);
		quotRow.quotes_favourite = Number(quotRow.quotes_favourite) + 1;
		this.quotesIncreateCount(quotRow.quotes_id, '3');
	}

	checkFavQuotes(quotes_id) {
		this.isFavVideo = false;
		for (let i in this.myFavQuotes) {
			if (this.myFavQuotes[i].quotes_id == quotes_id) {
				this.isFavVideo = true;
			}
		}
	}

	removeFavQuotes(quotRow) {
		this.admobS.rendomAdShow();
		for (let i in this.myFavQuotes) {
			if (this.myFavQuotes[i].quotes_id == quotRow.quotes_id) {
				this.myFavQuotes.splice(i, 1);
				quotRow.quotes_favourite = Number(quotRow.quotes_favourite) - 1;
				window.localStorage.setItem("FSVidstatusQuotes", JSON.stringify(this.myFavQuotes));
				setTimeout(() => {
					this.checkFavQuotes(quotRow.quotes_id);
				}, 100);
			}
		}
	}
	// Quotes Fav END

	async languagePopup() {
		const setCatLang = () => {
			for (let i in this.allVideoLangTemp) {
				this.allVideoLangTemp[i] = {
					type: 'checkbox',
					label: this.allVideoLanguage[i].language_name,
					value: this.allVideoLanguage[i].language_id,
					checked: this.isLangCheck(this.allVideoLanguage[i].language_id)
				}
			}
		}
		await setCatLang();
		const alert = await this.alertController.create({
			cssClass: 'my-custom-class',
			header: 'Videos Languages',
			inputs: this.allVideoLangTemp,
			buttons: [
				{
					text: 'Cancel',
					role: 'cancel',
					cssClass: 'secondary',
					handler: () => {
					}
				}, {
					text: 'Ok',
					handler: (res) => {
						this.selectedLang = res;
						console.log("this.selectedLang>>>", this.selectedLang)
						this.admobS.rendomAdShow();
						if (res.length) {
							window.localStorage.setItem("selectedLanguages", JSON.stringify(res));
							this.getHomeVideos({
								language_id: String(res),
								start: 0
							});
						}
					}
				}
			]
		});

		await alert.present();
	}


	async reportPopup(video_id, user_id) {
		const alert = await this.alertController.create({
			cssClass: 'my-custom-class',
			header: 'Report',
			inputs: [
				{
					name: 'Sexual',
					type: 'radio',
					label: 'Sexual',
					value: '1'
				},
				{
					name: 'copyright',
					type: 'radio',
					label: 'Copyright',
					value: '2'
				},
				{
					name: 'other',
					type: 'radio',
					label: 'Other',
					value: '3',
					checked: true
				}
			],
			buttons: [
				{
					text: 'Cancel',
					role: 'cancel',
					cssClass: 'secondary',
					handler: () => {
					}
				}, {
					text: 'Submit',
					handler: (res) => {
						let body = {
							user_id: user_id,
							video_id: video_id,
							report_reason: res
						}
						this.api.post('reportVideo', body).then((res) => {
							if (res['ResponseCode'] == 1) {
								this.messageToast(res['ResponseMsg']);
								this.admobS.rendomAdShow();
							} else {
								this.messageToast('Something went wrong');
							}
						}, err => {
							this.messageToast('Something went wrong');
						})
					}
				}
			]
		});
		await alert.present();
	}

	quotes() {
		this.router.navigate(['/quotes']);
	}

	async messageToast(message) {
		const toast = await this.tc.create({
			message: message,
			mode: 'ios',
			color: 'secondary',
			// position: 'middle',
			duration: 4000
		});
		toast.present();
	}

	async presentLoading(message) {
		this.loading = await this.loadingController.create({
			message: message,
			duration: 2000
		});
		await this.loading.present();
	}

	dissmisLoding() {
		this.loading.dismiss();
	}

	appShare() {
		this.socialSharing.share(
			` Full Screen Video Status  Full HD Video Status Free Download Now `,
			'',
			this.appLogo,
			'https://play.google.com/store/apps/details?id=com.goalsup.videostatus.fullscreenvideostatus'
		).then((res) => {

		}).catch((error) => {
			console.log("error>>>>>>>>>>>>>" + JSON.stringify(error));

		})
	}


	rateApp() {
		this.market.open('com.goalsup.videostatus.fullscreenvideostatus');
	}

	sortByKeyDesc = (array, key) => {
		return array.sort((a, b) => {
			let x = a[key];
			let y = b[key];
			return x > y ? -1 : x < y ? 1 : 0;
		});
	};

	randomInteger(min, max) {
		return Math.floor(Math.random() * (max - min + 1)) + min;
	}
}
